import React from 'react';
import { Typography, Stack, Box} from '@mui/material';

import HeroBannerImg  from '../assets/images/banner.jpg';
const HeroBanner = () => {
  return (
    <Box sx={{
        mt: {lg: '210px', xs:'70px'},
        ml: {sm:'50px'}
    }} position="relative" p="20px">
        
        <Typography color="#1B45CE" fontWeight={600} fontSize="26px">
            WISE-FIT
        </Typography>
        
        <Typography fontWeight={700}  color='#b2becd' sx={{ fontSize: {lg: '54px', xs: '40px'} }}>
            Sweet, Smile <br /> And Exercise
        </Typography>
        
        <Typography fontSize="22px" color='#dbe1e8' lineHeight="35px" mb={4}>
            Check out the most effective exercises
        </Typography>
        
        <Stack>
      <a href="#exercises" style={{ marginTop: '35px', textDecoration: 'none', width: '200px', textAlign: 'center', background: '#1B45CE', padding: '14px', fontSize: '22px', textTransform: 'none', color: '#dbe1e8', borderRadius: '4px' }}>Explore Exercises</a>
    </Stack>
    <Typography fontWeight={600} color="#ffffff" sx={{ opacity: '0.7', display: { lg: 'block', xs: 'none' }, fontSize: '200px', textAlign:'center' }}>
      Exercise
    </Typography>
    <img src={HeroBannerImg} alt="hero-banner" className="hero-banner-img" />
    </Box>
  )
}

export default HeroBanner
